CREATE DEFINER=`root`@`localhost` FUNCTION `materia_aprobada`(matricula integer , clave varchar(6)) RETURNS varchar(12) CHARSET utf8 COLLATE utf8_bin
BEGIN
declare materia varchar(60);
declare flag varchar(12);
set materia = (select m.nombre_mat
from alumno as a inner join total_materias as m
